import React from "react";

const Notes = () => {

return(
    <>
    
    
    <div className="container">

      <div className="d-flex flex-row my-3 ml-5">
            <div><a href="#notes" className="text-white bg-success p-4 m-2">Notes</a></div>
            <div><a href="#question" className="text-white bg-success p-4 m-2">Question</a></div>
            <div><a href="#gate" className="text-white bg-success p-4 m-2">Gate</a></div>
      </div>

      <h1 className="bg-danger text-white m-5">Uploaded Files</h1>

        <div className="row">
                
        <h1 id="notes">Subject Notes</h1>
          
          </div>
        </div>
      
    
    </>
);
};
export default Notes;
